import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import "./index.css";
import data from "./data";
// import App from "./App";
// import { Add, Divide, Mod, Mul, Sub } from "./Clc";

ReactDOM.render(
  <>
    <div className="cards container">
      <Card
        imgsrc=""
        title="A Netflix Orignal Series"
        sn="Stranger Things"
        link="https://www.netflix.com/in/"
      />
      <Card
        imgsrc="https://upload.wikimedia.org/wikipedia/en/d/da/DarkNetflixPosterEnglish.jpg"
        title="A Netflix Orignal Series"
      />
    </div>
  </>,
  document.getElementById("root")
);
